import React, { useEffect, useState } from 'react';
import axios from 'axios';
 

function He() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    axios.get('/get')
      .then(res => {
        setMessage(res.data);
      })
  }, []);

  const handleClick = () => {
    axios.post('/get', { data: '200 hello devin' })
      .then(res => {
        setMessage(res.data);
      })
  }

  return (
    <div className="App">
      <header className="App-header">
        {message}
      </header>

      <button onClick={handleClick}>Click me</button>
      <a href="/gets">Next</a>
    </div>
  );
}

export default He;
